DROP FUNCTION IF EXISTS calc_constalation; CREATE FUNCTION calc_constalation(o1 DOUBLE, o2 DOUBLE) RETURNS DOUBLE RETURN IF(IF(o1>o2, o1-o2, o2-o1)>180,360-IF(o1>o2, o1-o2, o2-o1),IF(o1>o2, o1-o2, o2-o1));
DROP FUNCTION IF EXISTS calc_fade; CREATE FUNCTION calc_fade(suspected DOUBLE, fade DOUBLE, getted DOUBLE) RETURNS DOUBLE RETURN IF(suspected > getted,IF((suspected - getted) / fade > 1.0 , 0, 1 - (suspected - getted) / fade),IF((getted - suspected) / fade > 1.0 , 0, 1 - (getted - suspected) / fade));
DROP FUNCTION IF EXISTS asp0; CREATE FUNCTION asp0(o1 DOUBLE, o2 DOUBLE) RETURNS DOUBLE RETURN calc_fade(0, 4.5, calc_constalation(o1, o2));
DROP FUNCTION IF EXISTS asp30; CREATE FUNCTION asp30(o1 DOUBLE, o2 DOUBLE) RETURNS DOUBLE RETURN calc_fade(30, 0.5, calc_constalation(o1, o2));
DROP FUNCTION IF EXISTS asp45; CREATE FUNCTION asp45(o1 DOUBLE, o2 DOUBLE) RETURNS DOUBLE RETURN calc_fade(45, 1, calc_constalation(o1, o2));
DROP FUNCTION IF EXISTS asp60; CREATE FUNCTION asp60(o1 DOUBLE, o2 DOUBLE) RETURNS DOUBLE RETURN calc_fade(60, 2.5, calc_constalation(o1, o2));
DROP FUNCTION IF EXISTS asp90; CREATE FUNCTION asp90(o1 DOUBLE, o2 DOUBLE) RETURNS DOUBLE RETURN calc_fade(90, 4, calc_constalation(o1, o2));
DROP FUNCTION IF EXISTS asp120; CREATE FUNCTION asp120(o1 DOUBLE, o2 DOUBLE) RETURNS DOUBLE RETURN calc_fade(120, 3.5, calc_constalation(o1, o2));
DROP FUNCTION IF EXISTS asp135; CREATE FUNCTION asp135(o1 DOUBLE, o2 DOUBLE) RETURNS DOUBLE RETURN calc_fade(135, 1.5, calc_constalation(o1, o2));
DROP FUNCTION IF EXISTS asp150; CREATE FUNCTION asp150(o1 DOUBLE, o2 DOUBLE) RETURNS DOUBLE RETURN calc_fade(150, 2, calc_constalation(o1, o2));
DROP FUNCTION IF EXISTS asp180; CREATE FUNCTION asp180(o1 DOUBLE, o2 DOUBLE) RETURNS DOUBLE RETURN calc_fade(180, 4.5, calc_constalation(o1, o2));
DROP FUNCTION IF EXISTS asp_sp; CREATE FUNCTION asp_sp(o1 DOUBLE, o2 DOUBLE) RETURNS DOUBLE RETURN IF(calc_constalation(0, o1)>calc_constalation(0, o2), calc_fade(calc_constalation(0, o1), 0.75, calc_constalation(0, o2)), calc_fade(calc_constalation(0, o2), 0.75, calc_constalation(0, o1))) + IF(calc_constalation(90, o1)>calc_constalation(90, o2), calc_fade(calc_constalation(90, o1), 0.75, calc_constalation(90, o2)), calc_fade(calc_constalation(90, o2), 0.75, calc_constalation(90, o1)));
